// Product.js
import "./DataProduts"
function Product() {
  return (
    <div className="child">
      <img src={imgSrc} alt={name} />
      <p>
        <strong>{name}</strong>
        <br />
        {price} դր/1կտ
        <br />
        <button className="btn">Գնել</button>
      </p>
    </div>
  );
}

export default Product;
